import React from "react";
import { BrowserRouter as Route, Switch } from "react-router-dom";
import HomeComponent from '../components/home-component';

const AppRouter = () => (
  <Switch>
    <Route path="/">
      <HomeComponent />
    </Route>
    <Route path="/User-Info">
      <HomeComponent />
    </Route>
  </Switch>
);

export default AppRouter;
